	public void addToAssettype(AssetType assettype) {
		if ( !this.assettype.isEmpty() ) {
			throw new RuntimeException("Property is a one and already has value, first clear it before adding!");
		}
		if ( assettype != null ) {
			List<UmlgConstraintViolation> violations = validateAssettype(assettype);
			if ( violations.isEmpty() ) {
				this.assettype.add(assettype);
			} else {
				throw new UmlgConstraintViolationException(violations);
			}
		}
	}
	
