	@Override
	public List<Qualifier> getQualifiers(UmlgRuntimeProperty tumlRuntimeProperty, UmlgNode node, boolean inverse) {
		List<Qualifier> result = Collections.emptyList();
		AssetRuntimePropertyEnum runtimeProperty;
		if ( !inverse ) {
			runtimeProperty = AssetRuntimePropertyEnum.fromQualifiedName(tumlRuntimeProperty.getQualifiedName());
		} else {
			runtimeProperty = AssetRuntimePropertyEnum.fromQualifiedName(tumlRuntimeProperty.getInverseQualifiedName());
		}
		if ( runtimeProperty != null && result.isEmpty() ) {
			switch ( runtimeProperty ) {
				default:
					result = Collections.emptyList();
			}
		
		}
		return result;
	}
	
	/**
	 * getSize is called from the BaseCollection.addInternal in order to save the sice of the inverse collection to update the edge's sequence order
	 * 
	 * @param inverse 
	 * @param tumlRuntimeProperty 
	 */
	@Override
	public int getSize(boolean inverse, UmlgRuntimeProperty tumlRuntimeProperty) {
		int result = 0;
		AssetRuntimePropertyEnum runtimeProperty;
		if ( !inverse ) {
			runtimeProperty = AssetRuntimePropertyEnum.fromQualifiedName(tumlRuntimeProperty.getQualifiedName());
		} else {
			runtimeProperty = AssetRuntimePropertyEnum.fromQualifiedName(tumlRuntimeProperty.getInverseQualifiedName());
		}
		if ( runtimeProperty != null && result == 0 ) {
			switch ( runtimeProperty ) {
				case Name:
					result = Name.size();
					break;
			
				case block:
					result = block.size();
					break;
			
				case Value:
					result = Value.size();
					break;
			
				case Available:
					result = Available.size();
					break;
			
				case board:
					result = board.size();
					break;
			
				case assettype:
					result = assettype.size();
					break;
			
				default:
					result = 0;
			}
		
		}
		return result;
	}
	
